import React, { useState } from 'react';

function Payments() {
    const [showAccountDetails, setShowAccountDetails] = useState(false);
    const [showPinEntry, setShowPinEntry] = useState(false);
    const [bsb, setBsb] = useState('');
    const [accountNumber, setAccountNumber] = useState('');
    const [pin, setPin] = useState('');

    const isContinueEnabled = bsb.replace(/\s+/g, '').length === 6 && accountNumber.replace(/\s+/g, '').length === 9;

    const formatNumberWithSpaces = (value) => {
        return value.replace(/\D/g, '') // ÁßªÈô§ÊâÄÊúâÈùûÊï∞Â≠óÂ≠óÁ¨¶
            .replace(/(\d{3})(?=\d)/g, '$1 '); // ÊØè‰∏â‰ΩçÊï∞Â≠óÂêéÈù¢Âä†‰∏Ä‰∏™Á©∫Ê†º
    };

    const handleBsbChange = (e) => {
        const formattedValue = formatNumberWithSpaces(e.target.value);
        setBsb(formattedValue);
    };

    const handleAccountNumberChange = (e) => {
        const formattedValue = formatNumberWithSpaces(e.target.value);
        setAccountNumber(formattedValue);
    };

    const handleContinueClick = () => {
        if (isContinueEnabled) {
            setShowPinEntry(true);
            setShowAccountDetails(false);
        }
    };

    const handlePinInput = (num) => {
        if (pin.length < 6) {
            setPin((prevPin) => prevPin + num);
        }
    };

    const styles = {
        container: {
            backgroundColor: '#f4f4f4',
            minHeight: '100vh',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            width: '100%',
            boxSizing: 'border-box',
            padding: 0,
            overflowX: 'hidden',
        },
        header: {
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center',
            width: '100%',
            marginBottom: '20px',
            boxSizing: 'border-box',
            padding: '10px',
        },
        headerText: {
            fontSize: '24px',
            fontWeight: 'bold',
        },
        quickActionsContainer: {
            display: 'flex',
            justifyContent: 'space-around',
            width: '60%',
            marginBottom: '20px',
        },
        quickActionButton: {
            backgroundColor: '#007bff',
            color: '#fff',
            padding: '15px 30px',
            borderRadius: '25px',
            textAlign: 'center',
            fontSize: '18px',
            cursor: 'pointer',
            flex: 1,
            margin: '0 10px',
        },
        quickPayContainer: {
            width: '90%',
            marginBottom: '20px',
        },
        quickPayHeader: {
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center',
            marginBottom: '10px',
        },
        quickPayHeader1: {
            fontSize: '25px',
            fontWeight: 'bold',
        },
        quickPayHeader2: {
            fontSize: '19px',
            color: '#007bff',
            cursor: 'pointer',
        },
        quickPayItems: {
            display: 'flex',
            justifyContent: 'space-around',
            alignItems: 'center',
        },
        quickPayItem: {
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            cursor: 'pointer',
        },
        quickPayIcon: {
            width: '60px',
            height: '60px',
            borderRadius: '50%',
            backgroundColor: '#ADD8E6',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            color: '#0066CC',
            fontSize: '24px',
            marginBottom: '5px',
        },
        scheduledContainer: {
            width: '90%',
            backgroundColor: '#fff',
            borderRadius: '10px',
            padding: '15px',
            boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
            marginBottom: '20px',
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center',
        },
        failedContainer: {
            width: '90%',
            backgroundColor: '#fff',
            borderRadius: '10px',
            padding: '15px',
            boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
            marginBottom: '20px',
            borderLeft: '5px solid red',
        },
        transactionList: {
            width: '90%',
            backgroundColor: '#fff',
            borderRadius: '10px',
            padding: '15px',
            boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
            marginBottom: '20px',
            boxSizing: 'border-box',
            margin: '0 20px',
        },
        transactionItem: {
            display: 'flex',
            justifyContent: 'space-between',
            marginBottom: '10px',
        },
        footer: {
            display: 'flex',
            justifyContent: 'space-around',
            width: '100%',
            backgroundColor: '#fff',
            padding: '10px 0',
            boxShadow: '0 -2px 8px rgba(0, 0, 0, 0.1)',
            marginTop: 'auto',
            boxSizing: 'border-box',
        },
        footerItem: {
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
            fontSize: '12px',
        },
        footerIcon: {
            fontSize: '24px',
            color: '#007bff',
            marginBottom: '5px',
        },
        accountDetailsContainer: {
            position: 'fixed',
            bottom: showAccountDetails ? '0' : '-100%',
            left: 0,
            width: '100%',
            height: '80%',
            backgroundColor: '#fff',
            borderTopLeftRadius: '20px',
            borderTopRightRadius: '20px',
            boxShadow: '0 -2px 8px rgba(0, 0, 0, 0.1)',
            transition: 'bottom 0.3s ease',
            padding: '20px',
            zIndex: 1000,
        },
        accountDetailsHeader: {
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center',
            marginBottom: '20px',
        },
        backButton: {
