                marginTop: '20px',
            },
            footerButton: {
                fontSize: '16px',
                color: '#007bff',
                cursor: 'pointer',
            },
        };

        const [activeKey, setActiveKey] = useState(null);

        const handleKeyClick = (num) => {
            setActiveKey(num);
            handlePinInput(num);
            setTimeout(() => setActiveKey(null), 150); // Áü≠ÊöÇÁöÑÁÇπÂáªÊïàÊûú
        };

        return (
            <div style={styles.container}>
                <div style={styles.header}>Enter Your Access PIN</div>
                <div style={styles.pinDots}>
                    {[...Array(6)].map((_, index) => (
                        <div key={index} style={styles.dot(index >= 6 - pin.length)}></div>
